The 1961-64 Mk I was essentially a slightly more expensive badge-engineered version of the Austin-Healey Sprite MKII. The doors had no external handles or locks and the windows were sliding Perspex side-screens. A hard top, heater, radio and luggage rack were available as factory fitted extras. The engine was a 948 cc with twin SU carburettors producing 46 hp. In October 1962 the engine was increased to 1098 cc. 
</p>
